import React from 'react';


const ActivityList = ({ activity }) => {
    return (
        <select id="Class-List">
            {
                activity.map((performed) => (
                    <li key={performed.id}>{performed.activityName}</li>
                ))}
        </select>
    )
}


export default ActivityList;
